INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3330141300064', 'Huile vierge de sésame biologique, graines du mali', 'DE SESAME I BIOLOGIQUE / SAVEUR DOUCE Fondée à Paris dans le Marais en 1822 la Maison AL\'OLIVIER s\'est imposée au fit des ans comme la spécialiste des huiles de qualité. Si notre marque est réputée pour l\'excellence de ses huiles d\'olive, elie se distingue aussi par l\'exhaustivité de son assortiment d\'huiles. Les graines de sésame issues de l\'Agriculture Biologique sont selectionnées auprès d\'agricu!îv du Mali. L\'huile est obtenue par première à froid mécanique. Cette opération est filtration sur papier. Cette méthode artisana garantit une faible acidité et conserve au rr: les arômes et les nutriments. Cette huile à la saveur douce est idé3 assaisonnement de salades vertes et de composées. Pensez à ajouter quelques g fin de cuisson sur des légumes sautés c Nous recommandons de ne pas la cuire.', '', '92', '12', '0', '0', '0', '0', '0', '0', '', '0');

